description:
SuperEx is the world's first Web3.0-based cryptocurrency exchange, creating the most intuitive user experience for everyone to trade cryptocurrencies. Our mission is to create a business concept and technical solution based on Web 3.0, to achieve decentralization of user assets and transactions, decentralization of the platform team, and complete decentralization of rights, driving user community autonomy with DAO, allowing billions of users to experience cryptocurrency first-hand and step into the Web 3.0 crypto world together.

Based on the same goals and values, we are forming DAOs based on different countries and regions to realize the complete community decentralization of SuperEx and successfully enter the era of WEB3.0 based on the blockchain field. The DAO of each country or region will have all the business management decision-making authority of SuperEx localization, and SuperEx will set up a DAO fund that will have 5% of all the income from that country or region into the DAO fund pool to incentivize and promote the development of decentralized communities in that country or region, which will be entirely voted on by the localized DAO members to decide on the use of the funds.

Required qualities to become a DAO member:

Responsibility: All services are centered on the interests of users, helping others, and being responsible for their own words and deeds;

Cognition: In-depth understanding of the development history and professional knowledge of blockchain and cryptocurrency; understanding of Web3.0 business management concepts and technical implementation plans.

Quest: In the face of new ideas, new things, and new products, maintain a mentality of seeking knowledge, learning, and exploring;

Efficiency: respond quickly, solve problems quickly, and produce high-quality service results;

Altruism: Doing what is good for others;

Tolerance: Tolerance is acceptable in the face of doubt, incomprehension and verbal attacks;

...



Responsibilities and obligations of DAO members:

SuperEx strives to serve users, operate local communities, develop localized users, and increase local brand awareness in localized communities as well as better serve local users.



DAO member benefits:

Dividend distribution rights and use rights of DAO funds;

Rewards for major achievements in localization development;

Other benefits of the platform from time to time;

...

As the first Web 3.0-based cryptocurrency exchange, SuperEx DAO is in the initial stages of development and we will continue to refine various details during the implementation.

